    [],nt"revision_timestamp": "2016-03-31T23:58:44.706882",nt"name": "enviroatlas-new-bedford-massachusetts-one-meter-resolution-urban-land-cover-data-2010",nt"isopen":
    false,nt"url": null,nt"notes": "The New Bedford, MA land cover data were
    generated from United States Department of Agriculture (USDA) National Agricultural
    Imagery Program (NAIP) four band (red, green, blue, and near infrared) aerial photography
    at 1 m spatial resolution. Imagery was collected in August of 2010. Seven land cover
    classes were mapped: water, impervious surfaces, soil and barren land, trees and
    forest, grass and herbaceous non-woody vegetation, woody wetlands and emergent wetlands.
    An accuracy assessment of 500 completely random and 45 stratified random points
    yielded an overall fuzzy accuracy of 92.3 percent. The area mapped is defined by
    the US Census Bureauu00e2??s 2010 Urban Statistical Area for New Bedford, MA plus
    a 1 km buffer. Additional areas where imagery was available but outside the 1 km
    boundary were also mapped but not included in the accuracy assessment. We expect
    the accuracy of the areas outside of the 1 km boundary to be consistent with those
    within. This dataset was produced by the US EPA to support research and online mapping
    activities related to EnviroAtlas. EnviroAtlas (https://www.epa.gov/enviroatlas)
    allows the user to interact with a web-based, easy-to-use, mapping application to
    view and analyze multiple ecosystem services for the contiguous United States. The
    dataset is available as downloadable data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas)
    or as an EnviroAtlas map service. Additional descriptive information about each
    attribute in this dataset can be found in its associated EnviroAtlas Fact Sheet
    (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).",nt"license_title":
